import './App.css';
import FuelQuoteForm from './FuelQuoteForm';
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
function App() {
  return (
   /* <div className="App">
      <h1>Hello World!</h1>
    </div>*/
<Router>
    <Routes>
    <Route exact path="/fuel-quote-form" element={<FuelQuoteForm/>} />
